// import PropTypes from 'prop-types';
import css from './Projects.module.css';
import { BsLink45Deg, BsGithub } from 'react-icons/bs';
import { loIceCream } from 'react-icons/lo';

export const Projects = ({ projects }) => {
  return (
    <div className={css.box}>
      <div className={css.header}>
        <h2 className={css.name}>Projects</h2>
      </div>
      <div className={css.projects}>
        {projects.map(({ title, describe, languages, site, git, image }) => (
          <figure className={css.items}>
            <figcaption>
              <h3 className={css.title}>{title}</h3>
              <p className={css.languages}>{languages}</p>
              <div className={css.link}>
                <a href={site}>
                  <BsLink45Deg></BsLink45Deg>
                </a>
                <a href={git}>
                  <BsGithub></BsGithub>
                </a>
              </div>
            </figcaption>
            <div>
              <loIceCream></loIceCream>
              <div className={css.animation}>
                <p className={css.describe}>{describe}</p>
              </div>
            </div>
          </figure>
        ))}
      </div>
    </div>
  );
};
